import './App.css';
import { useState } from 'react';

function App() {
  const [formData, setFormData] = useState({
    // Initialize your form data here
  });

  // Function to handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('http://localhost:5000/nominee/create', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        const responseData = await response.json();
        console.log('Nominee created:', responseData);
        // Optionally, you can perform further actions based on the response
      } else {
        const responseBody = await response.text();
        console.error('Error creating nominee:', response.statusText);
        console.log('Response body:', responseBody); // Log the response body
      }
    } catch (error) {
      console.error('Error creating nominee:', error.message);
    }
  };

  // Function to handle form input changes
  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        {/* Your form inputs go here */}
        <input type="text" name="name" placeholder="Nominee Name" onChange={handleChange} />
        <input type="text" name="email" placeholder="Nominee Email" onChange={handleChange} />
        {/* Add more inputs as needed */}

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
